import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Localizacao from './components/Localizacao';
import Formulario from './components/Formulario';

function App() {
  return (
    <div className="App">
      <Header/>
      <div className="teste">
      <Localizacao name={"teste"}/>
      <Formulario/>
      </div>
    </div>
  );
}

export default App;
